import { useQuery } from '@apollo/react-hooks';
import { QUERY_PRODUCT_PRICE } from '../graphql';

const useCustomHook = () => {
  const { data } = useQuery(QUERY_PRODUCT_PRICE);

  console.log(data);
};

export default useCustomHook;
